INSERT INTO `ezcontentobject_attribute` VALUES (0,287,109,0,NULL,'Mount Fuji','ezstring',567,'eng-GB',2,0,'mount fuji',1);
INSERT INTO `ezcontentobject_attribute` VALUES (0,287,109,0,NULL,'Mount Fuji','ezstring',567,'eng-GB',2,0,'mount fuji',2);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,109,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Mount Fuji</strong>, located on Honshu Island, is the highest mountain in Japan at 3,776.24 m (12,389 ft). An active stratovolcano that last erupted in 1707–08, Mount Fuji lies about 100 kilometres (60 mi) south-west of Tokyo, and can be seen from there on a clear day. Mount Fuji\'s exceptionally symmetrical cone, which is snow-capped several months a year, is a well-known symbol of Japan and it is frequently depicted in art and photographs, as well as visited by sightseers and climbers. It is one of Japan\'s \"Three Holy Mountains\" along with Mount Tate and Mount Haku; it is a Special Place of Scenic Beauty, a Historic Site, and was added to the World Heritage List as a Cultural Site on June 22nd, 2013.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"54\">Mount Fuji</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',568,'eng-GB',2,0,'',1);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,109,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Mount Fuji</strong>, located on Honshu Island, is the highest mountain in Japan at 3,776.24 m (12,389 ft). An active stratovolcano that last erupted in 1707–08, Mount Fuji lies about 100 kilometres (60 mi) south-west of Tokyo, and can be seen from there on a clear day. Mount Fuji\'s exceptionally symmetrical cone, which is snow-capped several months a year, is a well-known symbol of Japan and it is frequently depicted in art and photographs, as well as visited by sightseers and climbers. It is one of Japan\'s \"Three Holy Mountains\" along with Mount Tate and Mount Haku; it is a Special Place of Scenic Beauty, a Historic Site, and was added to the World Heritage List as a Cultural Site on June 22nd, 2013.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"54\">Mount Fuji</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>\n','ezxmltext',568,'eng-GB',2,0,'',2);
