INSERT INTO `ezcontentobject_attribute` VALUES (0,287,110,0,NULL,'Mount Matterhorn','ezstring',573,'eng-GB',2,0,'mount matterhorn',1);
INSERT INTO `ezcontentobject_attribute` VALUES (0,287,110,0,NULL,'Mount Matterhorn','ezstring',573,'eng-GB',2,0,'mount matterhorn',2);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,110,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>The <strong>Matterhorn</strong> (German), <strong>Monte Cervino</strong> (Italian) or <strong>Mont Cervin</strong> (French), is a mountain in the Pennine Alps on the border between Switzerland and Italy. Its summit is 4,478 metres (14,692 ft) high, making it one of the highest peaks in the Alps. The four steep faces, rising above the surrounding glaciers, face the four compass points. The mountain overlooks the town of Zermatt in the canton of Valais to the north-east and Breuil-Cervinia in the Aosta Valley to the south. Theodul Pass, located at the eastern base of the peak, is the lowest passage between its north and south side.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"56\">Matterhorn</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',574,'eng-GB',2,0,'',1);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,110,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>The <strong>Matterhorn</strong> (German), <strong>Monte Cervino</strong> (Italian) or <strong>Mont Cervin</strong> (French), is a mountain in the Pennine Alps on the border between Switzerland and Italy. Its summit is 4,478 metres (14,692 ft) high, making it one of the highest peaks in the Alps. The four steep faces, rising above the surrounding glaciers, face the four compass points. The mountain overlooks the town of Zermatt in the canton of Valais to the north-east and Breuil-Cervinia in the Aosta Valley to the south. Theodul Pass, located at the eastern base of the peak, is the lowest passage between its north and south side.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"56\">Matterhorn</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>\n','ezxmltext',574,'eng-GB',2,0,'',2);
