INSERT INTO `ezcontentobject_attribute` VALUES (0,287,111,0,NULL,'Mount Annapurna','ezstring',579,'eng-GB',2,0,'mount annapurna',2);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,111,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Annapurna</strong> (Sanskrit, Nepali, Nepal Bhasa: अन्नपुर्ण) is a section of the Himalayas in north-central Nepal that includes 8,091 m (26,545 ft) Annapurna I, thirteen additional peaks over 7,000 m (22,970 ft) and 16 more over 6,000 m (19,690 ft). This section is a 55 km-long (34 mi-long) massif bounded by the Kali Gandaki Gorge on the west, the Marshyangdi River on the north and east, and Pokhara Valley on the south. Annapurna I is tenth among Earth\'s fourteen <emphasize>eight-thousanders</emphasize>. 8167 metre Dhaulagiri I rises 34 km to the west across the Kali Gandaki Gorge, considered Earth\'s deepest canyon.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"57\">Annapurna</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',580,'eng-GB',2,0,'',1);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,111,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Annapurna</strong> (Sanskrit, Nepali, Nepal Bhasa: अन्नपुर्ण) is a section of the Himalayas in north-central Nepal that includes 8,091 m (26,545 ft) Annapurna I, thirteen additional peaks over 7,000 m (22,970 ft) and 16 more over 6,000 m (19,690 ft). This section is a 55 km-long (34 mi-long) massif bounded by the Kali Gandaki Gorge on the west, the Marshyangdi River on the north and east, and Pokhara Valley on the south. Annapurna I is tenth among Earth\'s fourteen <emphasize>eight-thousanders</emphasize>. 8167 metre Dhaulagiri I rises 34 km to the west across the Kali Gandaki Gorge, considered Earth\'s deepest canyon.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"57\">Annapurna</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>\n','ezxmltext',580,'eng-GB',2,0,'',2);
