INSERT INTO `ezcontentobject_attribute` VALUES (0,287,113,0,NULL,'Mount Kilimanjaro','ezstring',591,'eng-GB',2,0,'mount kilimanjaro',2);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,113,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Mount Kilimanjaro</strong>, with its three volcanic cones, <strong>Kibo</strong>, <strong>Mawenzi</strong>, and <strong>Shira</strong>, is a dormant volcanic mountain in Tanzania. It is the highest mountain in Africa and the highest free-standing mountain in the world at 5,895 metres or 19,341 feet abovesea level (the <strong>Uhuru Peak</strong>/<strong>Kibo Peak</strong>).</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"59\">Mount Kilimanjaro</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',592,'eng-GB',2,0,'',1);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,113,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Mount Kilimanjaro</strong>, with its three volcanic cones, <strong>Kibo</strong>, <strong>Mawenzi</strong>, and <strong>Shira</strong>, is a dormant volcanic mountain in Tanzania. It is the highest mountain in Africa and the highest free-standing mountain in the world at 5,895 metres or 19,341 feet abovesea level (the <strong>Uhuru Peak</strong>/<strong>Kibo Peak</strong>).</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"59\">Mount Kilimanjaro</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>\n','ezxmltext',592,'eng-GB',2,0,'',2);
