INSERT INTO `ezcontentobject_attribute` VALUES (0,288,114,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Stadda </strong>(in Lule Sami: <emphasize>Stádda</emphasize>) is a mountain in the municipality of Tysfjord in Nordland county, Norway. It is located about 15 kilometres (9 mi) northeast of the village of Kjøpsvik. The mountain has very smooth sides reaching all the way to the fjord. Stetind has an obelisk-shape which gives it a very distinct look. In 2002 it was voted to be the \"National Mountain\" of Norway by listeners of NRK.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"60\">Mount Stetind</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',598,'eng-GB',2,0,'',1);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,114,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Stadda </strong>(in Lule Sami: <emphasize>Stádda</emphasize>) is a mountain in the municipality of Tysfjord in Nordland county, Norway. It is located about 15 kilometres (9 mi) northeast of the village of Kjøpsvik. The mountain has very smooth sides reaching all the way to the fjord. Stetind has an obelisk-shape which gives it a very distinct look. In 2002 it was voted to be the \"National Mountain\" of Norway by listeners of NRK.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"60\">Mount Stetind</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>\n','ezxmltext',598,'eng-GB',2,0,'',2);
