INSERT INTO `ezcontentobject_attribute` VALUES (0,288,115,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Aconcagua</strong> (Spanish pronunciation: [akoŋˈkaɣwa]) is the highest mountain in the Western and Southern Hemispheres at 6,960.8 metres (22,837 ft). It is located in the Andes mountain range, in the province of Mendoza, Argentina, and lies 112 kilometres (70 mi) northwest of its capital, the city of Mendoza. The summit is also located about 5 kilometres from San Juan Province and 15 kilometres from the international border with Chile. Aconcagua is the highest peak in both the Western and Southern Hemispheres. It is one of the Seven Summits.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"61\">Aconcagua</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>','ezxmltext',604,'eng-GB',2,0,'',1);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,115,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Aconcagua</strong> (Spanish pronunciation: [akoŋˈkaɣwa]) is the highest mountain in the Western and Southern Hemispheres at 6,960.8 metres (22,837 ft). It is located in the Andes mountain range, in the province of Mendoza, Argentina, and lies 112 kilometres (70 mi) northwest of its capital, the city of Mendoza. The summit is also located about 5 kilometres from San Juan Province and 15 kilometres from the international border with Chile. Aconcagua is the highest peak in both the Western and Southern Hemispheres. It is one of the Seven Summits.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link target=\"_blank\" url_id=\"61\">Aconcagua</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>\n','ezxmltext',604,'eng-GB',2,0,'',2);
