INSERT INTO `ezcontentobject_attribute` VALUES (0,288,117,0,1045487555,'<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Castor</strong> (Italian: <emphasize>Castore</emphasize>) is a mountain in the Pennine Alps on the border between Valais, Switzerland and the Aosta Valley in Italy. It is the higher of a pair of twin peaks (Zwillinge), the other being Pollux, named after the Gemini twins of Roman mythology. Castor\'s peak is at an elevation of 4,228 m (13,871 ft), and it lies between Breithorn and Monte Rosa. It is separated from Pollux by a pass at 3,845 m (12,615 ft), named <emphasize>Passo di Verra</emphasize> in Italian and <emphasize>Zwillingsjoch</emphasize> in German. Ascents are usually made from the alpine hut <emphasize>Capanna Quintino Sella</emphasize> on the Italian side, by means of the Felikjoch and the long and narrow southeast ridge. From the Swiss side, ascents start from Klein Matterhorn and go by way of the Italian Mezzalama glacier and the mountain\'s west flank. The first ascent was made on August 23, 1861.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link url_id=\"63\">Mount Castor</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>. <link anchor_name=\"mediaviewer/File:Castore_per_la_cresta_sudorientale.JPG\" url_id=\"64\">Photo</link>: \"Castore per la cresta sudorientale\" by Franco56 - fotografia personale. Licensed under Creative Commons Attribution-Share Alike 3.0 via Wikimedia Commons.</custom></paragraph></section>','ezxmltext',616,'eng-GB',2,0,'',1);
INSERT INTO `ezcontentobject_attribute` VALUES (0,288,117,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><strong>Castor</strong> (Italian: <emphasize>Castore</emphasize>) is a mountain in the Pennine Alps on the border between Valais, Switzerland and the Aosta Valley in Italy. It is the higher of a pair of twin peaks (Zwillinge), the other being Pollux, named after the Gemini twins of Roman mythology. Castor\'s peak is at an elevation of 4,228 m (13,871 ft), and it lies between Breithorn and Monte Rosa. It is separated from Pollux by a pass at 3,845 m (12,615 ft), named <emphasize>Passo di Verra</emphasize> in Italian and <emphasize>Zwillingsjoch</emphasize> in German. Ascents are usually made from the alpine hut <emphasize>Capanna Quintino Sella</emphasize> on the Italian side, by means of the Felikjoch and the long and narrow southeast ridge. From the Swiss side, ascents start from Klein Matterhorn and go by way of the Italian Mezzalama glacier and the mountain\'s west flank. The first ascent was made on August 23, 1861.</paragraph><paragraph><custom name=\"sub\">This article uses material from the Wikipedia article <link url_id=\"63\">Mount Castor</link>, which is released under the <link target=\"_blank\" url_id=\"55\">Creative Commons Attribution-ShareAlike License</link>. <link url_id=\"64\" anchor_name=\"mediaviewer/File:Castore_per_la_cresta_sudorientale.JPG\">Photo</link>: \"Castore per la cresta sudorientale\" by Franco56 - fotografia personale. Licensed under Creative Commons Attribution-Share Alike 3.0 via Wikimedia Commons.</custom></paragraph></section>\n','ezxmltext',616,'eng-GB',2,0,'',2);
